 palette='viridis', # Paleta de cores para o gráfico\n    errorbar=None\n) \nplt.title('Precipitação total por região', fontsize=16)\nplt.xlabel('Região', fontsize=14)\nplt.ylabel('Precipitação total (mm)', fontsize=14)\nplt.xticks(rotation=45)\nplt.grid(axis='y')\n\n\"\"\"\n\nTemperatura: Usar a média é melhor porque te dá uma visão geral e confiável das temperaturas ao longo do tempo.\nPrecipitação: Somar é melhor porque você quer saber quanto choveu no total, o que é importante para entender o clima e o impacto na agricultura, por exemplo.\n\n\"\"\"\n\n# Ajustando o layout\nplt.tight_layout()\nplt.show()\n","metadata":{"execution":{"iopub.status.busy":"2024-09-19T13:58:45.319163Z","iopub.execute_input":"2024-09-19T13:58:45.320411Z","iopub.status.idle":"2024-09-19T13:58:46.608847Z","shell.execute_reply.started":"2024-09-19T13:58:45.320350Z","shell.execute_reply":"2024-09-19T13:58:46.607438Z"},"trusted":true},"execution_count":55,"outputs":[{"output_type":"display_data","data":{"text/plain":"<Figure size 1500x800 with 2 Axes>","image/png":""},"metadata":{}}]}]}